          <article className="title-container-text">
            <h1>Cositas Bonitas</h1>
            <p>
              ¡Los mejores regalos los podes encontrar acá!
              También podes contactarnos para pedirnos algo personalizado
            </p>
          </article>
        </div>
        <ItemList />
      </section>
    );
  };

